function paDashBoardUser(ajaxService,sharedProperties,spConfig){this.getEmployeeCandidateStats=function(id){return ajaxService.getAjaxResponse({url:spConfig.talentAnalytics.dashboard.getEmployeeCandidateStats}).then(function(response){return"true"===response.Success?response:null!==response.error?(sharedProperties.ajaxError(response.error),null):void 0})},this.getDashboardSettingsDetail=function(id){return ajaxService.getAjaxResponse({url:spConfig.talentAnalytics.dashboard.getDashboardSettingsDetail}).then(function(response){if("true"===response.Success)return response;null!==response.error&&sharedProperties.ajaxError(response.error)})},this.visitedDashboard=function(id){return ajaxService.getAjaxResponse({url:spConfig.talentAnalytics.dashboard.visitedDashboard}).then(function(response){if("true"===response.Success)return response;null!==response.error&&sharedProperties.ajaxError(response.error)})},this.articleDetail=function(id){return ajaxService.getAjaxResponse({url:spConfig.talentAnalytics.dashboard.knowledge+id,method:"GET"}).then(function(response){if("true"===response.Success)return response;null!==response.error&&sharedProperties.ajaxError(response.error)})}}paDashBoardUser.$inject=["ajaxService","sharedProperties","spConfig"],angular.module("spApp").service("paDashBoardUser",paDashBoardUser);